import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <header className="navbar-header">
      <nav className="navbar nav-rounded">
        <div className="navbar-logo">
          <span className="navbar-logo-icon">n</span>
          <span className="navbar-logo-text">rosie</span>
        </div>
        <ul className="navbar-links navbar-center-menu">
          <li><a href="#">Solutions <span className="navbar-arrow">▼</span></a></li>
          <li><a href="#">Industries <span className="navbar-arrow">▼</span></a></li>
          <li><a href="#">Resources</a></li>
          <li><a href="#">Pricing</a></li>
          <li><a href="#">Login</a></li>
        </ul>
        <div className="navbar-right-group">
          <a href="tel:4125690026" className="navbar-phone">412-569-0026</a>
          <a href="#" className="navbar-btn navbar-cta-btn">Start Free Trial</a>
        </div>
      </nav>
    </header>
  );
}

export default Navbar;
